import axios from 'axios';
import { useState, useEffect } from 'react';

function DisplaySimpson() {
  const [simpon, setSimpson] = useState([]);

  const getSimpson = () => {
    axios
      .get('https://simpsons-quotes-api.herokuapp.com/quotes?count=num')
      .then((res) => {
        setSimpson(res.data);
      });
  };

  return (
    <ul>
      {simpon.map((simpson) => (
        <li>{simpson.character}</li>
      ))}
    </ul>
  );
}
export default DisplaySimpson;
